  true,\n\t\"url\": null,\n\t\"notes\": \"The National Radiological Fixed Laboratory
  Data Asset includes data produced in support of various clients such as other EPA
  offices, EPA Regional programs, DOE, DOD, state agencies, and tribal support as
  well as support to other countries when requested. Analytical data for these clients
  range from support for entire projects to providing QA support only. A wide range
  of radiochemical and hazardous chemical analyses are performed on a variety of media.
  Data produced at NAREL are held to strict quality assurance standards and include
  all supporting documentation for complete data validation.\",\n\t\"license_title\":
